package uml;

public class Developer {
	private int developerId;
	private String name;
	
	
	
	public Developer() {
		super();
		// TODO Auto-generated constructor stub
	}


	public Developer(int developerId, String name) {
		super();
		this.developerId = developerId;
		this.name = name;
	}
	
	
	public int getDeveloperId() {
		return developerId;
	}
	public String getName() {
		return name;
	}

	

}
